}

  VendorServiceModel.fromJson(dynamic json) {
    _status = json['status'];
    _msg = json['msg'];
    if (json['restaurants'] != null) {
      _restaurants = [];
      json['restaurants'].forEach((v) {
        _restaurants?.add(Restaurants.fromJson(v));
      });
    }
  }
  num? _status;
  String? _msg;
  List<Restaurants>? _restaurants;
VendorServiceModel copyWith({  num? status,
